import React from "react";
import {Link} from "react-router-dom";
import { SentenceToChunk, SizeOfChunk } from "./InputTools";
import PracticeOn from "./PracticeOn";

export default class Practice extends React.Component {
    constructor(props){
        super(props)
    }
    getValuesFromInput(){
        this.props.setValues
    }
    render() {
        return (
            <div>
                <SentenceToChunk />
                <SizeOfChunk />
                <Link to = "/practice/on-going">
                    <button onClick ={<PracticeOn/>}>OK</button>
                </Link>
                <Link to = "/">
                    <button>Cancel</button>
                </Link>
            </div>
        );
    }
}
